import React from "react";
import "./CoverScreen.css";
import {Container} from "react-bootstrap";
const coverScreen = props => (
  <React.Fragment>
    <Container>
      <h1 className="name">{props.name}</h1>
    </Container>
  </React.Fragment>
);

export default coverScreen;
